INSERT INTO `humanevolution4co2` (`Time`, `Co2`, `Events`) VALUES
('1780', 279.5, 'mass production of spun textiles, mechanised by water power; coal-fired and steam-powered production of iron and steel (beginning Britain, c. 1780) _ economies of scale, rising polarisation of rich and poor nations, dominance of fossil fuels'),
('1860', 286.6, 'factory production of internal-combustion engines (Jean Lenoir, Belgium, 1860; user manual 1864) _ electricity generators, vehicular transport'),
('1882', 291.9, 'first commercially viable power stations, coal-fired (London and New York, 1882) _ electrical grid; fossil fuels providing 63% of global electricity generation by 2019'),
('1886', 293.7, 'first car with gasoline-powered internal combustion engine (Karl Benz, Germany, 1886) _ 97 million motor vehicles produced globally per year by 2017: peak production?'),
('1903', 298.5, 'first powered, controlled flight by a heavier-than-air aircraft (Orville and Wilbur Wright, USA, 17/12/1903) _ 4.4 billion airline passengers per year by 2019: peak volume?'),
('1947', 309.9, 'first supersonic flight, in a rocket-powered aircraft (Chuck Yeager in Bell X-1, USA, 14/10/1947) _ space exploration'),
('2015', 401.01, 'human land use, rising exponentially up to 1960, still rising in 2015 for livestock grazing (27% of global land area), crops (7%), buildings, towns and cities (1%); industrial fishing in 55% of ocean area by 2015');
INSERT INTO `humanevolution7co2` (`Time`, `Co2`, `Events`) VALUES
('-126000', 275.272, 'Homo with mix of archaic-human and Neanderthal traits (Nesher Ramla, Israel): stone-tool industry, cooking meat; cultural exchange with humans?'),
('-125000', 277.023, 'prelude to Earth\'s Last Glacial Period: global average temperature never again as high until CE 2021, during intensifying anthropogenic warming'),
('-70000', 215.7, 'cooking of crushed pulse seeds by Neanderthals (Shanidar Cave, Iraqi Kurdistan): tolerance of bitter and astringent tastes - food culture'),
('-50000', 204.801, 'Neanderthal fire-lighting technology (France): striking flint axes with mineral pyrite _ wood the predominant fuel for cooking and heating until the CE 19  century'),
('-31000', 188.195, 'processing of heat-dried wild oats with grindstones (Grotta Paglicci, Italy; soon appearing across Europe, Australia), to make flour for storage and cooking'),
('-20000', 192.169, 'beginning of sea-level rise from deglaciation in a warming global climate; stabilising at today\'s 120-m higher levels by c. 10,000 years ago'),
('-8000', 259.948, 'earliest mining of metal: heating, hammering and grinding copper into projectile points (Great Lakes, North America)'),
('-3000', 275.424, 'earliest extraction and working of iron (Anatolia) _ alloying with carbon to make steel in Cyprus by 1100 BCE');
